package data

import (
	"testing"
)

const (
	testDataURI = `data:image/png;base64,`
)

func TestDataURIUnmarshalText(t *testing.T) {
	dataURI := &DataURI{}
	if err := dataURI.UnmarshalText([]byte(testDataURI)); err != nil {
		t.Fatal(err)
	}
}

func BenchmarkDataURIUnmarshalText(b *testing.B) {
	dataURI := &DataURI{}
	for i := 0; i < b.N; i++ {
		if err := dataURI.UnmarshalText([]byte(testDataURI)); err != nil {
			b.Fatal(err)
		}
	}
}
